import logoImage from '../Images/logo.jpg';
import cleoImage from '../Images/cleo.jpg';
import cleopatraImage from '../Images/cleopatra.jpg';
import GremlinImage from '../Images/Gremlin.jpeg';

export default () => (

    <div> 
        <header>
            <img src= {logoImage} alt='logo' id='logoImage' />
        </header>
        <h1>Cats MEOW</h1>
        <style jsx global> {`
            header {
                background-color: grey;
                height: 80px;
                text-align: center;
                padding: 10px;
            }

            #logoImage {
                height: 60px;
            }

            h1 {
                text-align: center;
                font-size: 40px;
                margin: 10px;
            }

        `}</style>
    </div>

)
